import React from "react";

export default function About({ title, subtitle, dark, id, img_src }) {
  return (
    <div className={"section1" + (dark ? " section1-dark" : "")}>
      <div className="section1-content" id={id}>
        <h1>{title}</h1>
        <img src={img_src} width="460"></img>
        <p className={"section1-text"}>{subtitle}</p>
      </div>
    </div>
  );
}
